<!DOCTYPE html>

<head>
    <title>Store Logo Map with Clustering</title>
    <meta charset="utf-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link rel="stylesheet" href="https://unpkg.com/leaflet/dist/leaflet.css" />
    <link rel="stylesheet" href="https://unpkg.com/leaflet.markercluster@1.4.1/dist/MarkerCluster.css" />
    <link rel="stylesheet" href="https://unpkg.com/leaflet.markercluster@1.4.1/dist/MarkerCluster.Default.css" />
    <style>
        #map { height: 900px; }
        .logo-overlay {
            width: 25px;
            height: 25px;
        }
    </style>
</head>
<body>
    <div id="map"></div>
    <script src="https://unpkg.com/leaflet/dist/leaflet.js"></script>
    <script src="https://unpkg.com/leaflet.markercluster@1.4.1/dist/leaflet.markercluster.js"></script>
    <script>
        // Initialize the map and set view to Oregon
        var map = L.map('map').setView([44.0, -120.5], 7);

        // Add OpenStreetMap tile layer
        L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
            attribution: '&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
        }).addTo(map);

        // Create a marker cluster group
        var markers = L.markerClusterGroup();

        // Function to add logo overlay
        function addLogoOverlay(lat, lng, logoUrl) {
            var logoIcon = L.icon({
                iconUrl: logoUrl,
                iconSize: [50, 50],
                iconAnchor: [25, 25],
            });
            var marker = L.marker([lat, lng], { icon: logoIcon });
            markers.addLayer(marker); // Add marker to the cluster group
        }
